  `form` varchar(60) DEFAULT NULL COMMENT 'Path for form Sing up',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`),
  KEY `user_sys_service` (`service`),
  CONSTRAINT `user_sys_service` FOREIGN KEY (`service`) REFERENCES `services_old` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=latin1;

