/*!50003 CREATE */ /*!50003 TRIGGER `etat_connect_on_radacct_insert` BEFORE INSERT ON `radacct` FOR EACH ROW BEGIN
      UPDATE 
        radcheck 
      SET
        radcheck.`etat_connect` = (SELECT
          CASE
            WHEN radacct.`acctterminatecause` <> 'NAS-Request' 
